import React from "react";
import "./WorkHistory.css";

import Job from "../Job/Job";
import { workHistory } from "../../data";

function WorkHistory() {
  return (
    <div className="work-history">
      {workHistory.map((job) => (
        <Job job={job} />
      ))}
    </div>
  );
}

export default WorkHistory;
